@limor_moyal האהבה וההערכה הדדית. 
מצד שני, אני לא שיפוטית בנושא רומנים מחוץ לנישואין, ולא רוצה להיות פוריטנית בנושא הזה.
אין בזה תמיכה בבגידות במסגרת נישואין. הקורבנות שלה נובעת מהיחס של שני הגברים אליה. היא אישה בוגרת ורשאית לעשות החלטות אוטונומיות לגבי חייה והנישואין שלה

